import{_ as t}from"./chunks/data_upload.BprzPkGi.js";import{_ as a,a as n,b as o,c as s}from"./chunks/subset_formula.BUGDK4kU.js";import{_ as i,c as r,o as l,ag as c}from"./chunks/framework.BG_SpCm2.js";const d="/teamone/img/functions/teamone_formula.png",m="/teamone/img/functions/static_mode.png",u="/teamone/img/functions/quite_mode.png",h="/teamone/img/functions/zero_values.png",p="/teamone/img/functions/default_elements.png",g="/teamone/img/functions/alternative_hierarchy.png",f="/teamone/img/functions/teamone_formula_insert.png",b="/teamone/img/functions/mdx_formula_static_columns.png",v="/teamone/img/functions/mdx_formula_mdx_expression.png",y="/teamone/img/functions/mdx_formula_cube_view.png",w="/teamone/img/functions/username_formula.png",x="/teamone/img/functions/updated_formula.png",N=JSON.parse('{"title":"TeamOne","titleTemplate":"Formulas","description":"","frontmatter":{"title":"TeamOne","titleTemplate":"Formulas"},"headers":[],"relativePath":"doc/formulas.md","filePath":"doc/formulas.md"}'),E={name:"doc/formulas.md"};function T(k,e,A,q,_,S){return l(),r("div",null,e[0]||(e[0]=[c('<h1 id="formulas" tabindex="-1">Formulas <a class="header-anchor" href="#formulas" aria-label="Permalink to &quot;Formulas&quot;">​</a></h1><p>TeamOne formulas allow you to retrieve and write data from and to IBM Planning Analytics. Formula values are refreshed by clicking the Recalculate button in the TeamOne sidebar.</p><p>Google Sheets documents are live and collaborative, meaning all users see the same grid at the same time.</p><p>When TeamOne functions run, their results are written directly into the sheet. These results are not tied to a specific user session — they become part of the shared document and are immediately visible to all collaborators, regardless of whether they have an IBM Planning Analytics account.</p><h2 id="teamone-function" tabindex="-1">TEAMONE() Function <a class="header-anchor" href="#teamone-function" aria-label="Permalink to &quot;TEAMONE() Function&quot;">​</a></h2><p>The <code>TEAMONE()</code> function allows you to efficiently retrieve data from <strong>IBM Planning Analytics</strong> directly into Google Sheets based on the specified elements.</p><div class="tip custom-block"><p class="custom-block-title">Syntax</p><p><code>=TEAMONE(cubeName, rowElements, columnElements, contextFilters, options, solveOrder)</code></p></div><p><strong>Arguments</strong></p><ul><li><strong><code>cubeName</code></strong> – The name of the <strong>IBM Planning Analytics cube</strong> from which to retrieve data.</li><li><strong><code>rowElements</code></strong> – The selected cells defining the <strong>rows</strong> of your report.</li><li><strong><code>columnElements</code></strong> – The selected cells defining the <strong>columns</strong> of your report.</li><li><strong><code>contextFilters</code></strong> – The selected cells defining <strong>context filters</strong> to refine your data selection.</li><li><strong><code>options</code></strong> – A set of flags that modify how data is retrieved and displayed. Multiple flags can be combined (e.g., <code>&quot;AFSQZ&quot;</code>). Available flags: <ul><li><strong><code>A</code></strong> – Autofit column width</li><li><strong><code>F</code></strong> – Retrieve <strong>formatted</strong> values</li><li><strong><code>U</code></strong> – Enable <strong>updates</strong> to Planning Analytics</li><li><strong><code>S</code></strong> – Print <strong>static values</strong> instead of returning all values dynamically</li><li><strong><code>R</code></strong> – Reverse the <strong>sign</strong> of numeric values</li><li><strong><code>Q</code></strong> – Enable <strong>quiet mode</strong> (hides errors and warnings)</li><li><strong><code>Z</code></strong> – Display <strong>zero values</strong> instead of blanks</li><li><strong><code>L</code></strong> – <strong>Live</strong> evaluation of rows. Recommended for large formulas involving thousands of rows, to prevent the <a href="./issues.html#property-storage-quota">Property Storage Quota limit error</a></li><li><strong><code>X</code></strong> – <strong>eXclude</strong> the formula from recalculation. TeamOne will skip this formula when recalculating the sheet.</li></ul></li><li><strong><code>solveOrder</code></strong> – Specifies the <strong>formula evaluation priority</strong>. If omitted, the default value <strong>0</strong> is used.</li></ul><p><img src="'+d+'" alt="img" data-zoomable=""></p><p>For rows and columns, you can select single or multiple cells, and you can also include empty rows or columns:</p><div class="tip custom-block"><p class="custom-block-title">Retrieve data from Revenue cube, use formatted values and autofit columns</p><p><code>=TEAMONE(&quot;Revenue&quot;, A4:A5, B2:C3, A2:A3,&quot;AF&quot;)</code></p></div><div class="tip custom-block"><p class="custom-block-title">No columns (argument #3 is skipped), hardcoded context filter element &#39;Gross Revenue&#39;</p><p><code>=TEAMONE(&quot;Revenue&quot;, A4:A5, , &#39;Gross Revenue&#39;)</code></p></div><p>See <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit#gid=0" target="_blank" rel="noreferrer">=TEAMONE() formula example</a></p><h3 id="teamone-and-other-google-sheets-functions" tabindex="-1">TEAMONE and other Google Sheets functions <a class="header-anchor" href="#teamone-and-other-google-sheets-functions" aria-label="Permalink to &quot;TEAMONE and other Google Sheets functions&quot;">​</a></h3><p>Please note that you can only use one <code>TEAMONE()</code> function per cell. However, you can combine it with other Google Sheets functions:</p><div class="tip custom-block"><p class="custom-block-title">Get a SUM of all values returned by <code>TEAMONE()</code> function</p><p><code>=SUM( TEAMONE(B2,B10:C16,D8:G9,B5:B7) )</code></p></div><div class="tip custom-block"><p class="custom-block-title">Flips the sign by multiplying each value by -1</p><p><code>=ARRAYFORMULA( -1 * TEAMONE(B2,B10:C16,D8:G9,B5:B7) )</code></p></div><p>See more <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit?gid=77581571#gid=77581571" target="_blank" rel="noreferrer">=ARRAYFORMULA() formula examples</a></p><h3 id="autofit-columns" tabindex="-1">Autofit Columns <a class="header-anchor" href="#autofit-columns" aria-label="Permalink to &quot;Autofit Columns&quot;">​</a></h3><p>Use the <code>&quot;A&quot;</code> flag in the <code>TEAMONE()</code> function to automatically resize columns to fit the cell in each column that has the widest content.</p><h3 id="formatted-values" tabindex="-1">Formatted Values <a class="header-anchor" href="#formatted-values" aria-label="Permalink to &quot;Formatted Values&quot;">​</a></h3><p>Use the <code>&quot;F&quot;</code> flag in the <code>TEAMONE()</code> function to retrieve formatted cube values from IBM Planning Analytics. Alternatively, you can apply formatting in Google Sheets, which is easier and provides more formatting options.</p><h3 id="static-values" tabindex="-1">Static Values <a class="header-anchor" href="#static-values" aria-label="Permalink to &quot;Static Values&quot;">​</a></h3><p>When using the <code>&quot;S&quot;</code> flag, the <code>TEAMONE()</code> formula will return a single value (the very first one), and the remaining values will be printed as static. This flag is recommended when using the <code>TEAMONE()</code> formula with hundreds of rows and/or columns to avoid the error message:</p><p><em><strong>You have exceeded the property storage quota. Please remove some properties and try again.</strong></em></p><p>Additionally, the static mode allows you to insert calculated rows and columns between the rows and columns generated by the <code>TEAMONE()</code> calculation. In this mode, TEAMONE will disregard any rows where elements are not provided for the last row or column dimension (the distribution channel on the rows dimension and the year dimension on the columns in the example below):</p><p><img src="'+m+'" alt="img" data-zoomable=""></p><h3 id="update-mode" tabindex="-1">Update Mode <a class="header-anchor" href="#update-mode" aria-label="Permalink to &quot;Update Mode&quot;">​</a></h3><p>Use the <code>&quot;U&quot;</code> flag in the <code>TEAMONE()</code> function to enable data updates. The &quot;U&quot; flag also turns on static values as described above. You can submit the formula&#39;s data to IBM Planning Analytics using the <a href="./functions.html#upload-data">upload data</a> button available on the content tab.</p><p><img src="'+t+'" alt="img" data-zoomable=""></p><h3 id="quiet-mode" tabindex="-1">Quiet Mode <a class="header-anchor" href="#quiet-mode" aria-label="Permalink to &quot;Quiet Mode&quot;">​</a></h3><p>If you skip some cube dimensions, TeamOne will automatically use <em><strong>default elements</strong></em> for those dimensions and will add them to the cell notes. Use the <code>&quot;Q&quot;</code> flag in the <code>TEAMONE()</code> function to disable notes for omitted dimensions.</p><p><img src="'+u+'" alt="img" data-zoomable=""></p><h3 id="zero-values" tabindex="-1">Zero values <a class="header-anchor" href="#zero-values" aria-label="Permalink to &quot;Zero values&quot;">​</a></h3><p>Use the <code>&quot;Z&quot;</code> flag in the <code>TEAMONE()</code> function to display zero values instead of blank cells.</p><p><img src="'+h+'" alt="img" data-zoomable=""></p><h3 id="repetitive-elements" tabindex="-1">Repetitive elements <a class="header-anchor" href="#repetitive-elements" aria-label="Permalink to &quot;Repetitive elements&quot;">​</a></h3><p>If you have multiple rows and/or columns, you don&#39;t have to specify repetitive elements for each row or column. TeamOne will automatically use the same element name if the next rows/columns are blank.</p><p><img src="'+a+'" alt="img" data-zoomable=""></p><h3 id="multiple-formulas-performance" tabindex="-1">Multiple formulas performance <a class="header-anchor" href="#multiple-formulas-performance" aria-label="Permalink to &quot;Multiple formulas performance&quot;">​</a></h3><p>If using the same title elements, row/column dimensions, and formula flags, TeamOne will automatically detect and build a single query for each group of similar formulas, resulting in better performance.</p><h3 id="solve-order" tabindex="-1">Solve order <a class="header-anchor" href="#solve-order" aria-label="Permalink to &quot;Solve order&quot;">​</a></h3><p>If you need to use the results of <code>TEAMONE()</code>, <code>ATTR()</code>, or <code>SUBSET()</code> functions as arguments for another <code>TEAMONE()</code>, <code>ATTR()</code>, or <code>SUBSET()</code> function, you can specify the <code>solveOrder</code> to control the order in which those results are recalculated. <code>solveOrder</code> must be 1 or greater. If omitted, the default value of 0 will be used.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>It is recommended to use the same <em>solveOrder</em> value for multiple formulas that can be recalculated at the same time, as using multiple different values might increase the time taken to recalculate all formulas.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>For both <code>TEAMONE()</code> and <code>ATTR()</code> functions, you can skip the <em>options</em> argument before specifying the <em>solveOrder</em> value. For example:</p><p><code>=ATTR(&#39;product&#39;, &#39;21002&#39;, &#39;Product Color&#39;, 2)</code></p></div><h3 id="default-elements" tabindex="-1">Default elements <a class="header-anchor" href="#default-elements" aria-label="Permalink to &quot;Default elements&quot;">​</a></h3><p>If you do not include elements from all cube dimensions, TeamOne will automatically select the default member for each skipped dimension and add a corresponding note to the cell. Use the <a href="#quiet-mode">quiet mode</a> option to suppress notes.</p><p><img src="'+p+'" alt="img" data-zoomable=""></p><h3 id="ambiguous-element-names" tabindex="-1">Ambiguous element names <a class="header-anchor" href="#ambiguous-element-names" aria-label="Permalink to &quot;Ambiguous element names&quot;">​</a></h3><p>If you have elements with the same names in multiple dimensions, you can clarify the dimension name by using the following syntax: <code>dimension^hierarchy^element</code></p><p>You can also specify the hierarchy if needed (see below).</p><h3 id="alternative-hierarhies" tabindex="-1">Alternative hierarhies <a class="header-anchor" href="#alternative-hierarhies" aria-label="Permalink to &quot;Alternative hierarhies&quot;">​</a></h3><p>Use the <code>dimension^hierarchy^element</code> syntax to specify the dimension and hierarchy for any title element or the first element of any row/column range.</p><p><img src="'+g+'" alt="img" data-zoomable=""></p><h3 id="connection-name" tabindex="-1">Connection name <a class="header-anchor" href="#connection-name" aria-label="Permalink to &quot;Connection name&quot;">​</a></h3><p><code>TEAMONE()</code> function always fetches data from the currently selected connection. Use <code>ConnectionName:CubeName</code> syntax to retrieve data from a different configured connection.</p><div class="tip custom-block"><p class="custom-block-title">Revenue cube in TeamOneTest environment</p><p><code>=TEAMONE(&quot;TeamOneTest:Revenue&quot;, A4:A5, B2:C3, A2:A3)</code></p></div><h3 id="create-formulas-automatically" tabindex="-1">Create formulas automatically <a class="header-anchor" href="#create-formulas-automatically" aria-label="Permalink to &quot;Create formulas automatically&quot;">​</a></h3><p>You can let TeamOne build (autogenerate) the <em>=<code>TEAMONE()</code></em> formula for you using an existing cube/view on the <em>Model</em> tab or from the exploration menu:</p><p><img src="'+f+'" alt="img" data-zoomable=""></p><h2 id="mdx-function" tabindex="-1">MDX() function <a class="header-anchor" href="#mdx-function" aria-label="Permalink to &quot;MDX() function&quot;">​</a></h2><p>The <strong>MDX()</strong> function enables the creation of reports with dynamic rows and columns by providing <strong>MDX (Multidimensional Expressions)</strong>. It allows for dynamic data retrieval from <strong>IBM Planning Analytics</strong>, generating rows and columns based on expressions rather than fixed cell references.</p><div class="tip custom-block"><p class="custom-block-title">Syntax</p><p><code>=MDX(cubeName, rowElements, columnElements, contextFilters, options)</code></p></div><p><strong>Arguments</strong></p><ul><li><strong><code>cubeName</code></strong> – The name of the <strong>IBM Planning Analytics cube</strong> from which to retrieve data.</li><li><strong><code>rowElements</code></strong> – <strong>MDX expressions</strong> that define the <strong>rows</strong> dynamically.</li><li><strong><code>columnElements</code></strong> – <strong>MDX expressions</strong> that define the <strong>columns</strong> dynamically or specify an element range.</li><li><strong><code>contextFilters</code></strong> – The selected cells that define <strong>context filters</strong> to refine the data selection.</li><li><strong><code>options</code></strong> – A set of flags that modify how data is retrieved and displayed. Multiple flags can be combined (e.g., <code>&quot;FSRCGI&quot;</code>). Available flags: <ul><li><strong><code>F</code></strong> – Retrieve <strong>formatted</strong> values</li><li><strong><code>S</code></strong> – Print <strong>static values</strong> instead of returning all values dynamically</li><li><strong><code>G</code></strong> – <strong>Group</strong> consecutive rows with the same element name, displaying it only once.</li><li><strong><code>I</code></strong> – <strong>Indent</strong> element names based on hierarchy levels using leading spaces.</li><li><strong><code>R</code></strong> – Include <strong>empty rows</strong> in the result</li><li><strong><code>C</code></strong> – Include <strong>empty columns</strong> in the result</li><li><strong><code>H</code></strong> – Hide the <strong>column headers</strong></li><li><strong><code>Z</code></strong> – Display <strong>zero values</strong> instead of blanks</li><li><strong><code>X</code></strong> – <strong>eXclude</strong> the formula from recalculation. TeamOne will skip this formula when recalculating the sheet.</li></ul></li></ul><h3 id="dynamic-rows-and-columns" tabindex="-1">Dynamic rows and columns <a class="header-anchor" href="#dynamic-rows-and-columns" aria-label="Permalink to &quot;Dynamic rows and columns&quot;">​</a></h3><p>You can specify dimension expressions for both rows and columns using the following format: <code>dimName1^setExpression~aliasName * dimName2^setExpression~aliasName * ...</code></p><p>You can provide multiple dimension expressions separated by &quot; * &quot; (space asterisk space). Each expression should have the following structure: <code>dimName^setExpression</code></p><p>You can specify an alternative hierarchy by using the following syntax: <code>dimName^hierName^setExpression</code></p><p>You can specify an alias by using the following syntax: <code>dimName^setExpression~aliasName</code></p><p>If no alias is specified, the functinon will return the element principal names.</p><p>For the <em>setExpression</em> you can use an existing subset name, MDX, MDX mods or element list, using the same <a href="#set-expression"><em><strong>set expressions</strong></em></a> as in the <a href="#subset-function"><em><strong>=SUBSET()</strong></em></a> function.</p><p><img src="'+n+'" alt="img" data-zoomable=""> See <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit?gid=1794108640#gid=1794108640" target="_blank" rel="noreferrer">=MDX() formula example with set expressions</a></p><p>The MDX() function will also return the column headers unless you specify the <code>&quot;H&quot;</code> option flag.</p><h3 id="dynamic-rows-and-static-columns" tabindex="-1">Dynamic rows and static columns <a class="header-anchor" href="#dynamic-rows-and-static-columns" aria-label="Permalink to &quot;Dynamic rows and static columns&quot;">​</a></h3><p>You can use the <code>MDX()</code> selecting a column range similar to the <code>TEAMONE()</code> function. TeamOne will automatically find the dimension names:</p><p><img src="'+b+'" alt="img" data-zoomable=""></p><p>See <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit?gid=195431724#gid=195431724" target="_blank" rel="noreferrer">=MDX() formula example with static column elements</a></p><h3 id="mdx-expression" tabindex="-1">MDX expression <a class="header-anchor" href="#mdx-expression" aria-label="Permalink to &quot;MDX expression&quot;">​</a></h3><p>You can provide an MDX expression in the <code>MDX()</code> function, for instance, you can copy-paste from IBM Planning Analytics Workspace:</p><p><img src="'+v+'" alt="img" data-zoomable=""></p><p>See <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit?gid=349641449#gid=349641449" target="_blank" rel="noreferrer">=MDX() formula example with MDX expression</a></p><h3 id="cube-view" tabindex="-1">Cube view <a class="header-anchor" href="#cube-view" aria-label="Permalink to &quot;Cube view&quot;">​</a></h3><p>You can provide a cube view name in the <code>MDX()</code> function using the following syntax:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>cubeName^viewName</span></span></code></pre></div><p><img src="'+y+'" alt="img" data-zoomable=""></p><p>See <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit?gid=349641449#gid=349641449" target="_blank" rel="noreferrer">=MDX() formula example with a cube view</a></p><h2 id="attr-function" tabindex="-1">ATTR() function <a class="header-anchor" href="#attr-function" aria-label="Permalink to &quot;ATTR() function&quot;">​</a></h2><p><code>ATTR()</code> function retrieves the specified attribute value for the specified elements.</p><div class="tip custom-block"><p class="custom-block-title">Syntax</p><p><code>=ATTR(dimensionName, elements, attrName, attributeName, solveOrder)</code></p></div><p><strong>Arguments</strong></p><ul><li><strong><code>dimensionName</code></strong> – The name of the <strong>dimension</strong>. You can also specify an alternative hierarchy using the syntax <strong><code>dimName:hierName</code></strong>.</li><li><strong><code>elements</code></strong> – The selected cells representing the <strong>elements</strong> for which the attribute value should be retrieved.</li><li><strong><code>attributeName</code></strong> – The <strong>attribute name</strong>, such as <code>&quot;Caption&quot;</code>, that defines which attribute value to return.</li><li><strong><code>options</code></strong> – A set of flags that modify how data is retrieved and displayed. Available flags: <ul><li><strong><code>S</code></strong> – Print <strong>static values</strong> instead of returning all values dynamically</li><li><strong><code>X</code></strong> – <strong>eXclude</strong> the formula from recalculation. TeamOne will skip this formula when recalculating the sheet.</li></ul></li><li><strong><code>solveOrder</code></strong> – Specifies the <strong>formula evaluation priority</strong>. If omitted, the default value <strong>0</strong> is used.</li></ul><p><img src="'+o+'" alt="img" data-zoomable=""></p><p>See <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit#gid=1901571147" target="_blank" rel="noreferrer">=ATTR() formula example</a></p><h3 id="dimension-name" tabindex="-1">Dimension name <a class="header-anchor" href="#dimension-name" aria-label="Permalink to &quot;Dimension name&quot;">​</a></h3><p>To specify a dimension name, simply enter the name. Alternatively, you can use the syntax <em>dimName:hierName</em> to specify an alternative hierarchy.</p><h3 id="element-range" tabindex="-1">Element range <a class="header-anchor" href="#element-range" aria-label="Permalink to &quot;Element range&quot;">​</a></h3><p>Select cells in a spreadsheet, you can choose a single cell, or a range of multiple horizontal or vertical cells. TeamOne will ignore any empty cells that are included in the range.</p><p><img src="'+o+'" alt="img" data-zoomable=""></p><h2 id="subset-function" tabindex="-1">SUBSET() function <a class="header-anchor" href="#subset-function" aria-label="Permalink to &quot;SUBSET() function&quot;">​</a></h2><p>The <code>SUBSET()</code> function retrieves dimension elements using the provided set expression.</p><div class="tip custom-block"><p class="custom-block-title">Syntax</p><p><code>=SUBSET(dimName, setExpression, attrName, options, solveOrder)</code></p></div><p><strong>Arguments</strong></p><ul><li><strong><code>dimName</code></strong> – The name of the <strong>dimension</strong>. You can also specify an alternative hierarchy using the syntax <strong><code>dimName:hierName</code></strong>.</li><li><strong><code>setExpression</code></strong> – A valid <strong>MDX expression</strong>, <code>$SubsetName</code>, or <a href="./functions.html#mdx-mods"><strong>MDX mods</strong></a>.</li><li><strong><code>attrName</code></strong> – The <strong>attribute name</strong>, such as <code>&quot;Caption&quot;</code>, that defines which attribute value to return.</li><li><strong><code>options</code></strong> – A set of flags that modify how data is retrieved and displayed. Available flags: <ul><li><strong><code>S</code></strong> – Print <strong>static values</strong> instead of returning all values dynamically</li><li><strong><code>I</code></strong> – <strong>Indent</strong> element names based on hierarchy levels using leading spaces.</li><li><strong><code>A</code></strong> – Expand <strong>above</strong>, display children elements above the consolidation</li><li><strong><code>X</code></strong> – <strong>eXclude</strong> the formula from recalculation. TeamOne will skip this formula when recalculating the sheet.</li></ul></li><li><strong><code>solveOrder</code></strong> – Specifies the <strong>formula evaluation priority</strong>. If omitted, the default value <strong>0</strong> is used.</li></ul><p><img src="'+s+'" alt="img" data-zoomable=""></p><p>See <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit#gid=557987930" target="_blank" rel="noreferrer">=SUBSET() formula example</a></p><h3 id="set-expression" tabindex="-1">Set Expression <a class="header-anchor" href="#set-expression" aria-label="Permalink to &quot;Set Expression&quot;">​</a></h3><p>You can provide a valid <strong>MDX expression</strong> or use <strong>TeamOne subset syntax</strong> to define a set of elements. The following formats are supported:</p><ul><li><strong>Semicolon-delimited element list</strong> – A list of elements separated by semicolons. <ul><li>Example: <code>Jan;Feb;Mar</code></li></ul></li><li><strong>Pattern matching</strong> – Use wildcards to match elements dynamically: <ul><li><code>*</code> – Matches any sequence of characters.</li><li><code>?</code> – Matches any single character.</li><li>Example: <code>/*substring*/</code> or <code>/*FY202? */</code></li></ul></li><li><strong>Subset name reference</strong> – Use a dollar sign (<code>$</code>) before a subset name. <ul><li>Example: <code>$My subset name</code></li></ul></li><li><strong>Subset <a href="./functions.html#subset-keywords">keywords</a></strong> – Predefined keywords for dynamic element selection. <ul><li><code>$ALL</code> - All dimension elements</li><li><code>$ROOTS</code> - Top-level dimension elements</li><li><code>$LEAVES</code> - Leaf-level elements</li></ul></li></ul><p>You can also combine <strong>elements, patterns, MDX expressions, <a href="./functions.html#subset-keywords">subset keywords</a>, and <a href="./functions.html#mdx-mods">MDX mods</a></strong> in a <strong>semicolon-delimited list</strong> for advanced selections.</p><ul><li>Example:<div class="language-text vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">text</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>$roots&gt;&gt;expand;{[month].[Q1].children};/FY20??/&gt;&gt;sortasc</span></span></code></pre></div></li></ul><h2 id="username-function" tabindex="-1">USERNAME() function <a class="header-anchor" href="#username-function" aria-label="Permalink to &quot;USERNAME() function&quot;">​</a></h2><p><code>USERNAME()</code> function returns the current user name from the IBM Planning Analytics connection. This function has no arguments.</p><p><img src="'+w+'" alt="img" data-zoomable=""></p><p>See <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit?gid=1486768434" target="_blank" rel="noreferrer">=USERNAME() formula example</a></p><h2 id="updated-function" tabindex="-1">UPDATED() function <a class="header-anchor" href="#updated-function" aria-label="Permalink to &quot;UPDATED() function&quot;">​</a></h2><p><code>UPDATED()</code> function returns the date and time the current sheet data was refreshed from IBM Planning Analytics. This function has no arguments.</p><p><img src="'+x+'" alt="img" data-zoomable=""></p><p>See <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit?gid=1486768434" target="_blank" rel="noreferrer">=USERNAME() formula example</a></p>',120)]))}const D=i(E,[["render",T]]);export{N as __pageData,D as default};
